import Header from "./Header";
import Footer from "./Footer";
import "./Home.scss";

const Body = () => (
  <div className="main">
    <p className="topLefttext1">
      SAVE IN BITS <br />
      EVERY
      {/* <h1 style={{ backgroundColor: "#F2C438" }}> */}
      TIME YOU SPEND.
      <br /> EARN DOLLARS DAILY.
    </p>
    <div className="topRightDiv"></div>

    <div className="rowDiv">
      <div className="rowDiv1">A</div>
      <div className="rowDiv2">B</div>
      <div className="rowDiv3">C</div>
    </div>
  </div>
);

function Home() {
  return (
    <Fragment>
      {/* <Header /> */}
      <Body />
      {/* <Footer /> */}
    </Fragment>
  );
}

export default Home;
